import React from "react";
import PageContainer from "../../components/PageContainer";

const Home: React.FC = () => {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  return (
    <>
      <PageContainer>
        <h1>Home</h1>
      </PageContainer>
    </>
  );
};

export default Home;
